import React, { Component } from 'react'
class User extends Component {
    getInitialProps(){
        
    }
    render(){
        return(
            <div>
            Name: {this.props.name}
            <br />
            Age: {this.props.age}
            <style jsx>{`
                div {
                    border : 1px solid #eee;
                    box-shadow : 0 2px 3px #ccc;
                    padding: 20px;
                    text-align : center;
                }
            `}</style>
        </div>
        )
    }
    
}
export default User
